const Nav = () => {
    return (
        <>
            <nav class="navbar">


                <div class="logo">
                    <img src={Logo} alt="Logo" />

                </div>



                <ul class="nav-links">
                    <li><Link to="/">Home</Link></li>
                    <li><Link to="/AboutUs">About Us</Link></li>
                    <li><Link to="/AriDesigns">Products</Link></li>
                    <li><Link to="/ContactUs">Contact Us</Link></li>
                    <li><Link to="/Login">Login</Link></li>

                </ul>
            </nav>
        </>

    )
}

export default Nav;
